methods.description:
proc freq data = pilot.adsl;
  tables (ittfl saffl efffl comp24fl disconfl)*trt01pn / missing;
run;

proc freq data=adsl;
  table COMP24FL*TRT01P/chisq fisher exact;
run;

proc freq data=adsl;
  where COMP24FL="N";
  table DCREASCD* TRT01P/ chisq fisher exact;
run;

proc glm data = ADQSADAS;
  where EFFFL='Y' and ANL01FL='Y' and AVISIT='Week 24' and PARAMCD="ATOT";
  class sitegr1;
  model CHG = trtpn sitegr1;
run;

proc glm data = ADQSADAS;
  where EFFFL='Y' and ANL01FL='Y' and AVISIT='Week 24' and PARAMCD="ATOT";
  class trtpn sitegr1;
  model CHG = trtpn sitegr1 base;
  means trtpn;
  lsmeans trtpn / OM STDERR PDIFF CL;
run;

proc glm data = ADQSCIBC;
  where EFFFL='Y' and ANL01FL='Y' and AVISIT='Week 24' and PARAMCD="CIBICVAL";
  class sitegr1;
  model AVAL = trtpn sitegr1;
run;

proc glm data = ADQSCIBC;
   where EFFFL='Y' and ANL01FL='Y' and AVISIT='Week 24' and PARAMCD="CIBICVAL";
   class trtpn sitegr1; 
   model AVAL = trtpn sitegr1;
   means trtpn;
   lsmeans trtpn / OM STDERR PDIFF CL;
run;

PROC UNIVARIATE data= ADQSNPIX (where =(EFFFL = 'Y' and PARAMCD = 'NPTOTMN' and AVISIT='Weeks 4-24' and ANL01FL= 'Y')); 
 Var BASE AVAL;
 By TRTPN;
Run;

PROC MIXED data= ADQSNPIX (where =(EFFFL = 'Y' and PARAMCD = 'NPTOTMN' and AVISIT = 'Weeks 4-24' and ANL01FL= 'Y'));
  class sitegr1 trtpn;
  model aval = trtpn sitegr1 base;
  lsmeans trtpn / diff pdiff cl;
Run;

PROC FREQ (WHERE=(SAFFL="Y" and ANL01FL ="Y" and index(PARAMCD,"_")=0));
  BY PARCAT1 PARAMCD;
  TABLES TRTPN*LBNRIND/ALL FISHER;
run;

PROC  FREQ(WHERE=(SAFFL="Y" and ANL01FL ="Y" and index(PARAMCD,"_")));
  BY PARCAT1 PARAMCD;
  TABLES TRTPN*ANRIND/ALL FISHER;
RUN;

PROC FREQ (WHERE=(SAFFL="Y" and index(PARAMCD,"_")=0));
  TABLES PARCAT1*PARAMCD*AVISITN*TRTPN*BNRIND*ANRIND;
RUN;

PROC  FREQ(WHERE=(SAFFL="Y" and ANL01FL="Y" and index(PARAMCD,"_")=0)) t;
  BY PARCAT1 PARAMCD;
 TABLES BNRIND*TRTPN*ANRIND / cmh ;
RUN;

proc lifetest data = adtte (where=(saffl="Y"))  plots=s;
 id usubjid;
 strata trtan;
 time aval*cnsr(1);
 test trtan;
run;
